import { Route, Link, BrowserRouter as Router,Switch } from 'react-router-dom'

class App extends Component { 

  constructor(props){
    super(props)
  }

  render(){
    return (
      <div >
          <Router>
            <Switch>
              <Route exact path='/' component={Form}/>
            </Switch>
          </Router>
      </div> 
    );
  }
}
